import React from 'react';

const TemplateSelector = ({ loadTemplate }) => {
  const templates = [
    {
      id: 1,
      name: 'Simple Business Landing',
      elements: [
        { id: Date.now(), type: 'text', content: 'Welcome to Our Business' },
        { id: Date.now(), type: 'button', content: 'Get Started' },
      ]
    },
    {
      id: 2,
      name: 'Product Showcase',
      elements: [
        { id: Date.now(), type: 'image', src: 'https://via.placeholder.com/150' },
        { id: Date.now(), type: 'text', content: 'Amazing Product' },
      ]
    },
  ];

  return (
    <div className="template-selector">
      <h2>Select a Template</h2>
      {templates.map((template) => (
        <div key={template.id} className="template" onClick={() => loadTemplate(template)}>
          <h3>{template.name}</h3>
        </div>
      ))}
    </div>
  );
};

export default TemplateSelector;
